import React from 'react';
import './Video.css'
import ReactPlayer from "react-player";
import video from '../../../../images/homevideo.mp4'

const Video = () => {
    return (
        <div className='video'>
            <div class="container">
                <div className="line" />
                <h2 class="title">
                    <span class="title-word title-word-1">Wellcome</span>
                    <span class="title-word title-word-2">to</span>
                    <span class="title-word title-word-3">yugi</span>
                </h2>
                <div className="line" />

            </div>
            <div className='content_text' >
                <h3>FREE TO PLAY</h3>
                <p>A war takes place that shakes the entire universe, causing Gods of different civilizations and heroes to clash with each other.
                    .</p>
            </div>
            <div className="player-wrapper" style={{ margin: "50px", textAlign: "center" }}>
                <ReactPlayer
                    url="https://www.youtube.com/watch?v=YpHmFfmb7Io&t=1s&ab_channel=YUGI"
                    className="react-player"
                    playing={false}
                    width="auto"
                    height="600px"
                    controls={true}
                    volume={1}

                />
            </div>
        </div>
    );
}

export default Video;
